import React, { useEffect, useState } from 'react'
import Axios from 'axios'
function ToDoList() {
  const [task,setTask] = useState({});
  const fetchTask = async () =>{
    const {data} = await Axios.get('http://localhost:8000/api/v1/task');
    const task = data
    setTask(task);
  };
  useEffect(() =>{
    fetchTask();
  },[]);
  return (
    <div>
      <h2>To-Do list</h2>
      console.log({task})
      <p key={task.id}>{task}</p>
    </div>
  )
}

export default ToDoList
